import React from 'react';
import '../../App.css';

export default function Products() {
  return (
  <div className='products'><div>Our website is under revamping</div>
  <div className='contact-info'>
    <div className='tel-info'>
Tel: 21857010
    </div>
    <div className='fax-info'>
Fax: 39091597
</div>
<div className='email-info'>
Email: info@hacson.hk
</div>
    </div></div>

  );
}
